import React from 'react';
import './App.css';

import Player from './components/player/Player'
import Map from './components/map/Map'

function App() {
  return <>
    <div style={{
            position: "relative",
            margin: "auto",
            width: "800px",
            height: "600px",
    }}>
      <Map />
      <Player />
    </div>
  </>
}

export default App;
